---
apiVersion: v1
kind: ImageStream
metadata:
  name: packager-dashboard
spec:
  lookupPolicy:
    local: false
status:
  dockerImageRepository: ""
---
apiVersion: v1
kind: ImageStream
metadata:
   name: packager-dashboard-redis
spec:
  tags:
  - name: latest
    from:
      kind: DockerImage
      name: gcr.io/bitnami-containers/redis:latest
---
apiVersion: v1
kind: ImageStream
metadata:
   name: oraculum-frontend
spec:
  lookupPolicy:
    local: false
  tags:
  - name: latest
    from:
      kind: ImageStreamTag
      name: oraculum-frontend
status:
  dockerImageRepository: ""
---
apiVersion: v1
kind: ImageStream
metadata:
   name: packager-dashboard-frontend
spec:
  tags:
  - name: latest
    from:
      kind: DockerImage
      name: quay.io/fzatlouk/packager-dashboard:latest
